import './App.scss';
import React from "react";
import Header from "./Components/Header/Header";
import {BrowserRouter} from "react-router-dom";
import {Route, Switch} from "react-router";
import Patient from "./Components/Main Content/Patient/Patient";

function App() {
    return (
        <div className="application">
            <BrowserRouter>
                <Header/>
                <main className="main-content">

                    <div className={'wave'}>
                        <svg viewBox="0 0 500 150" preserveAspectRatio="none" className={'inner'}>
                            <path d="M-1.97,132.72 C213.60,135.69 472.63,-57.72 499.72,90.28 L500.00,0.00 L0.00,0.00 Z"
                                  className={'m'}></path>
                        </svg>
                    </div>
                    <Switch>
                        <Route exact path="/patient" component={Patient}/>
                    </Switch>
                </main>

            </BrowserRouter>

        </div>
    );
}

export default App;
